/* eslint-disable func-names */
/* eslint-disable consistent-return */
/* eslint-disable react/prop-types */
import React from 'react';
import styled from 'styled-components';

const TopstoriesContent = props => {
	const Wrapper = styled.div`
		display: flex;
		flex-direction: row;
		align-items: center;
		padding: 10px;
		background-color: #f2f2f2;
	`;

	const plasticPollutionArticles = props.getArticles.map(items => {
		const finalUrl = `https://www.rappler.com${items.url}`;
        let articleID = items.id;
        let imgPath = items.images[0].tn;
        let img = new URL(imgPath).pathname;
		return (
			<div key={articleID} className={styles.articlesWrapperSecChild}>
				<div className={styles.articleImgWrapper}>
					<img className={`nolazy`} src={`https://assets.rappler.com${img}`} />
				</div>
				<a href={finalUrl}>{items.title}</a>
			</div>
		);
	});

	const getTopStories = props.getData.map(items => {
		return <p key={items.id}>{items.title}</p>;
	});
	return <Wrapper>{getTopStories}</Wrapper>;
};

export default TopstoriesContent;
